import ImageOne from '../images/house1.jpg'
import ImageTwo from '../images/house2.jpg'
import ImageThree from '../images/house3.jpg'

const SliderData = [
    {
        title: 'Victoria House',
        price: '1,000,000.00',
        path: '/homes',
        label: 'View Home',
        image: ImageOne,
        alt: 'House'
    },
    {
        title: 'Victoria House 2',
        price: '2,000,000.00',
        path: '/homes',
        label: 'View Home',
        image: ImageTwo,
        alt: 'House'
    },
    {
        title: 'Victoria House 3',
        price: '3,000,000.00',
        path: '/homes',
        label: 'View Home',
        image: ImageThree,
        alt: 'House'
    }
];

export default SliderData;
